import React from 'react';
import './Suplementos.css';
import Barra from '../Navbar/Navbar';
import { Card, CardGroup, Button, Col, Row, Container } from 'react-bootstrap';

export const Suplementos = () => {
  return (
      <div>
          <Barra />
        <div>
            <h1>Suplementos</h1>
            <Container>
              <Row>
                <Col>
                </Col>
              </Row>
            </Container>
        </div>
    </div>
  );
};

export default Suplementos;
